import React from "react";
import MainScreen from "../../components/MainScreen";
import { Button } from "react-bootstrap";
import { Link } from "react-router-dom";
const MyLists = () => {
  return <MainScreen title="Welcome Back Basil...">

  <Link to='createlist'>
    <Button>

      Create New List
    </Button>
  </Link>
  </MainScreen>;
};

export default MyLists;
